import React from 'react';
import { useNavigate } from 'react-router-dom';
import ComboBox from './components/ComboBox';
import EnterButton from './components/EnterButton';
import { useState } from 'react';




function HomePage() {
  const [phoneNumber, setPhoneNumber] = useState('');

  const handleInputChange = (event) => {
    setPhoneNumber(event.target.value);
  };

  const handleSubmit = () => {
    alert(`Số điện thoại bạn đã nhập: ${phoneNumber}`);
  };
  return (
    <div style={{ padding: '20px' }}>
      <h1>Nhập Số Điện Thoại</h1>
      <ComboBox value={phoneNumber} onChange={handleInputChange} />
      <EnterButton onClick={handleSubmit} />
    </div>
  );



  const navigate = useNavigate(); // Hook để điều hướng

  const goToMenuPage = () => {
    navigate('/MenuPage'); // Điều hướng đến trang khác
  };

  return (
    <div>
      <h1>Trang chính</h1>
      <button onClick={goToMenuPage}>Đi đến trang khác</button>
    </div>
  );
}

export default HomePage;
